console.log('' + JSON.stringify(response));
if(response && response.token){
let queryStr = encodeURIComponent(selectionText);
debug_sink(\search")
chrome.runtime.sendMessage({type: 'search',wd:queryStr}, function(res) {
console.log(res)
});
}
});
}
